    /*
    - bài này ta tạo ra 4 mảng thì 2 mảng để chứa các giá trị đã thêm ;à tmp, 2 chuỗi kiểm tra đã tồn tại hay chưa là flag
    - ta tạo cờ là nhằm mục đích kiểm tra sự duy nhất của input sang output và ngược lại.
    - ta cho chạy 1 vòng lặp,
    - đầu tiên là cứ cho kiểm tra giá trị ánh xạ out put ứng vói vị trí trong mảng của kí tự output đấy là
    có tương ứng với giá trị input trước đó đã thêm vào là "đã tồn tại" hay chưa.
    thì sau đấy sẽ
     */
    public boolean isIsomorphic(String s, String t) {
        char[] tmp = new char[127];
        boolean[] flag = new boolean[127];
        boolean[] flag1 = new boolean[127];
        char[] tmp1 = new char[127];
        for (int i = 0; i < s.length(); i++) {
            if (flag1[t.charAt(i)]) {
                if (tmp1[t.charAt(i)] != s.charAt(i)) return false;
            }
            if (!flag[s.charAt(i)]) {
                tmp[s.charAt(i)] = t.charAt(i);
                flag[s.charAt(i)] = true;
                flag1[t.charAt(i)] = true;

            } else {
                if (tmp[s.charAt(i)] != t.charAt(i)) {
                    return false;
                }
            }
            tmp1[t.charAt(i)] = s.charAt(i);
        }
        return true;
    }

    public boolean isIsomorphic1ms(String sString, String tString) {
        if (sString.length() != tString.length()) {
            return false;
        }

        char[] s = sString.toCharArray();
        char[] t = tString.toCharArray();
        int length = s.length;

        // ASCII 문자 256개를 담을 수 있는 char array
        char[] sm = new char[256];
        char[] tm = new char[256];

        for (int i = 0; i < length; i++) {
            char sc = s[i];
            char tc = t[i];
            if (sm[sc] == 0 && tm[tc] == 0) {
                // 없는 문자라면 문자 ASCII 번호를 index 로 하는 배열에 char 를 저장
                sm[sc] = tc;
                tm[tc] = sc;
            } else {
                // 있는 문자라면
                if (sm[sc] != tc || tm[tc] != sc) {
                    // s와 t 서로 다른 대응되는 문자가 있을 경우
                    return false;
                }
            }
        }

        return true;
    }

    public boolean isIsomorphic1a(String s, String t) {
        char[] c1 = new char[128], c2 = new char[128];
        for (int i = 0; i < s.length(); i++) {
            if (c1[s.charAt(i)] != 0 && t.charAt(i) != c1[s.charAt(i)] ||
                    c2[t.charAt(i)] != 0 && s.charAt(i) != c2[t.charAt(i)]) return false;
            c1[s.charAt(i)] = t.charAt(i);
            c2[t.charAt(i)] = s.charAt(i);
        }
        return true;

    }
